//  POST 05    Реле
//...........................
int Rele_1 =  10;    // Контакт SH_CP


/////////////////////////////////////////////////////////// 
void setup() 
{
 
    pinMode(     Rele_1, OUTPUT);                            
    pinMode(LED_BUILTIN, OUTPUT); 
}




///////////////////////////////////////////////////////////
void loop() 
{
     for(int i = 0; i < 20; i ++)
     {
          digitalWrite(     Rele_1, HIGH);
          digitalWrite(LED_BUILTIN, HIGH);
          delay(100100);
          digitalWrite(     Rele_1, LOW);
          digitalWrite(LED_BUILTIN, LOW);
          delay(15000);
     }

}
